import React from "react";

const MyCourse = (userReview = null) => {
  const userReviewData = userReview?.userReview;
  console.log("마이코스", userReview);
  console.log("옵셔널 체이닝 후", userReviewData);
  return (
    <div>
      {userReviewData.map((data) => {
        return (
          <>
            <p>data.name</p>
            <p>data.info</p>
            <p>data.sort</p>
            <p>data.time</p>
          </>
        );
      })}
    </div>
  );
};

export default MyCourse;
